using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Activities;
using System.ComponentModel;
using System.Drawing;

namespace ChineseToPY
{
    [ToolboxBitmap(typeof(ChineseToPY), "拼音.png")]
    [DisplayName("汉字转拼音首字母")]
    [Description("输入汉字，输出拼音首字母")]
    public class ChineseToPY : NativeActivity
    {
        [Category("输入")]
        [DisplayName("输入")]
        [Description("中文")]
        public InArgument<string> Chinese { get; set; }


        [Category("输出")]
        [DisplayName("返回值")]
        [Description("拼音首字母")]
        public OutArgument<string> Result { get; set; }

        public string inputChinese;
        public static string 拼音字母列表
        {
            get
            {
                return "";
            }
        }
        protected override void Execute(NativeActivityContext context)
        {
            inputChinese = Chinese.Get(context);

            Result.Set(context, toPY());
            //Console.WriteLine(Chinese.Get(context));
        }
        public string toPY()
        {
            System.Text.StringBuilder myStr = new System.Text.StringBuilder();
            foreach (char vChar in inputChinese)
            {
                if ((int)vChar >= 19968 && (int)vChar <= 40869)
                    myStr.Append(拼音字母列表[(int)vChar - 19968]);
                else
                    myStr.Append(char.ToUpper(vChar));
            }
            return myStr.ToString();
        }
       
    }
}
